import React from 'react'
import {Link} from 'react-router-dom';

const Hero = () => {
    return (
        <section>
        <div class="flex flex-wrap flex-col md:flex-row items-center w-full">
            //Content
            <div class="container flex flex-col w-full md:w-2/5 pt-10 md:pt-0 justify-center items-center md:items-start text-center md:text-left">
                <p class="text-4xl md:text-6xl font-bold  pb-10">Whiteboard<br />Collaboration<br />Made Easy</p>

                <button class="rounded-sm px-8 py-4 text-xl bg-red-400 text-red-100 hover:bg-red-500 duration-300 shadow w-32">
                    <p class="text-sm font-bold text-white text-center">GET STARTED</p>
                </button>

            </div> 

            //Image
            <div class="w-full md:w-3/5 text-center">
                <img src="./imgs/hero_image.svg"  alt="" />
            </div>

        </div>



    </section>
    )
}

export default Hero
